import React from "react";
import './login.css'

function Login (props) {



    return (
        <>
        <span>Login Form</span>
        <label htmlFor="">Username</label>
        <input type="text" placeholder={props.name}/>
        <label htmlFor="">Password</label>
        <input type="password" />
        </>
    )
}

export default Login;
